Lo("io/args.effekt",'module io/args\n\nimport effekt\nimport immutable/list\nimport mutable/array\n\nextern io def nativeArgs(): Array[String] \x3d "process.argv.slice(2)"\n\ndef commandLineArgs(): List[String] \x3d nativeArgs().toList\n');Lo("immutable/list.effekt",'module immutable/list\n\nimport effekt\nimport immutable/option\n\nrecord EmptyList()\n\ntype List[A] {\n  Nil();\n  Cons(head: A, tail: List[A])\n}\n\ndef foreach[A](l: List[A]) { f: A \x3d\x3e Unit } : Unit \x3d {\n  var remainder \x3d l\n  while(not(remainder.isEmpty)) {\n    remainder match {\n      case Nil() \x3d\x3e ()\n      case Cons(a, as) \x3d\x3e f(a); remainder \x3d as\n    }\n  }\n}\n\ndef foreachIndex[T](list: List[T]){ f: (Int, T) \x3d\x3e Unit}: Unit \x3d {\n  def worker[T](list: List[T], i: Int){ f: (Int, T) \x3d\x3e Unit}: Unit \x3d {\n    list match {\n      case Nil() \x3d\x3e ();\n      case Cons(head, tail) \x3d\x3e f(i, head); worker(tail, i+1){f}\n\n    }\n  };\n  worker(list,0){f};\n}\n\ndef map[A, B](l: List[A]) { f: A \x3d\x3e B } : List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { el \x3d\x3e acc \x3d Cons(f(el), acc) }\n  acc.reverse\n}\n\ndef collect[A, B](l: List[A]) { f : A \x3d\x3e Option[B] }: List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { a \x3d\x3e\n    val optB \x3d f(a)\n    optB match {\n      case None() \x3d\x3e ();\n      case Some(b) \x3d\x3e acc \x3d Cons(b, acc);\n    }\n  }\n  acc.reverse\n}\n\ndef flatMap[A, B](l: List[A]) { f : A \x3d\x3e List[B] }: List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { a \x3d\x3e\n    val bs \x3d f(a)\n    acc \x3d acc.append(bs)\n  }\n  acc\n}\n\ndef sum(list: List[Int]): Int \x3d {\n  var n \x3d 0;\n  list.foreach { x \x3d\x3e n \x3d n + x };\n  n\n}\n\ndef size[A](l: List[A]): Int \x3d {\n  var n \x3d 0;\n  l.foreach { _ \x3d\x3e n \x3d n + 1 };\n  n\n}\n\ndef reverse[A](l: List[A]): List[A] \x3d {\n  var res \x3d Nil[A]()\n  l.foreach { el \x3d\x3e res \x3d Cons(el, res) }\n  res\n}\n\n// [1,2,3].reverseOnto([4,5,6])\n// [3,2,1,4,5,6]\ndef reverseOnto[A](l: List[A], other: List[A]): List[A] \x3d l match {\n  case Nil() \x3d\x3e other\n  case Cons(a, rest) \x3d\x3e rest.reverseOnto(Cons(a, other))\n}\n\n// [1,2,3].append([4,5,6])\n// [3,2,1].reverseOnto([4,5,6])\n// [1,2,3,4,5,6]\ndef append[A](l: List[A], other: List[A]): List[A] \x3d\n  l.reverse.reverseOnto(other)\n\n// gracefully fails\ndef take[A](l: List[A], n: Int): List[A] \x3d\n  if (n \x3d\x3d 0) {\n    Nil()\n  } else l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(a, rest) \x3d\x3e Cons(a, rest.take(n - 1))\n  }\n\ndef drop[A](l: List[A], n: Int): List[A] \x3d\n  if (n \x3d\x3d 0) {\n    l\n  } else l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(a, rest) \x3d\x3e rest.drop(n - 1)\n  }\n\ndef isEmpty[A](l: List[A]): Boolean \x3d l match {\n  case Nil() \x3d\x3e true\n  case Cons(a, rest) \x3d\x3e false\n}\n\ndef nonEmpty[A](l: List[A]): Boolean \x3d l match {\n  case Nil() \x3d\x3e false\n  case Cons(a, rest) \x3d\x3e true\n}\n\ndef head[A](l: List[A]): A / Exception[EmptyList] \x3d l match {\n  case Nil() \x3d\x3e do raise(EmptyList(), "Trying to get the head of an empty list")\n  case Cons(a, rest) \x3d\x3e a\n}\n\ndef tail[A](l: List[A]): List[A] / Exception[EmptyList] \x3d l match {\n  case Nil() \x3d\x3e do raise(EmptyList(), "Trying to get the head of an empty list")\n  case Cons(a, rest) \x3d\x3e rest\n}\n\ndef headOption[A](l: List[A]): Option[A] \x3d l match {\n  case Nil() \x3d\x3e None()\n  case Cons(a, rest) \x3d\x3e Some(a)\n}\n\n// elements that satisfy the predicate go into the left list\ndef partition[A](l: List[A]) { pred: A \x3d\x3e Boolean }: (List[A], List[A]) \x3d {\n  var lefts: List[A] \x3d Nil()\n  var rights: List[A] \x3d Nil()\n  l.foreach { el \x3d\x3e\n    if (pred(el)) { lefts \x3d Cons(el, lefts) }\n    else { rights \x3d Cons(el, rights) }\n  };\n\n  (lefts.reverse, rights.reverse)\n}\n\n// this implementation is not stacksafe!\ndef sortBy[A](l: List[A]) { compare: (A, A) \x3d\x3e Boolean }: List[A] \x3d\n  l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(pivot, rest) \x3d\x3e\n      val (lt, gt) \x3d rest.partition { el \x3d\x3e compare(el, pivot) };\n      val leftSorted \x3d sortBy(lt) { (a, b) \x3d\x3e compare(a, b) }\n      val rightSorted \x3d sortBy(gt) { (a, b) \x3d\x3e compare(a, b) }\n      leftSorted.append(Cons(pivot, rightSorted))\n  }\n\ndef sort(l: List[Int]): List[Int] \x3d l.sortBy { (a, b) \x3d\x3e a \x3c b }\ndef sort(l: List[Double]): List[Double] \x3d l.sortBy { (a, b) \x3d\x3e a \x3c b }\n');
Lo("immutable/dequeue.effekt","module immutable/dequeue\n\nimport immutable/list\nimport immutable/option\n\n// An implementation of a functional dequeue, using Okasaki's\n// bankers dequeue implementation.\n//\n// Translation from the Haskell implementation:\n//   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Boolean \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n");
Lo("immutable/option.effekt","module immutable/option\n\nimport effekt\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Boolean \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Boolean \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\n// Interop with JS\n// ---------------\n// These functions should only be used by libraries that interface with native JS\n\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\ndef nullToOption[A](value: A): Option[A] \x3d\n  if (value.isNull) { None() } else { Some(value) }\n\ndef nullishToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined || value.isNull) { None() } else { Some(value) }\n");
