Lo("mutable/array.effekt",'module mutable/array\n\nimport immutable/option\nimport immutable/list\n\n// A mutable 0-based indexed array, backed by a JavaScript array.\nextern type Array[T]\n\ndef emptyArray[T](): Array[T] \x3d emptyArray(0)\n\n// Creates a new Array of size `size` filled with the value `default`\ndef fill[T](size: Int, default: T): Array[T] \x3d {\n  val arr \x3d emptyArray[T](size)\n  each(0, arr.size()) { i \x3d\x3e\n    put(arr, i, default)\n  }\n  return arr;\n}\n\n// Builds a new Array of size `size` from a computation `index` which gets an index\n// and returns a value that will be on that position in the resulting array\ndef build[T](size: Int) { index: Int \x3d\x3e T }: Array[T] \x3d {\n  val arr \x3d emptyArray[T](size)\n  each(0, arr.size()) { i \x3d\x3e\n    put(arr, i, index(i))\n  }\n  return arr\n}\n\n// Converts a List `list` to an Array\ndef fromList[T](list: List[T]): Array[T] \x3d {\n  val listSize \x3d list.size();\n  val arr \x3d emptyArray(listSize);\n\n  foreachIndex(list) { (i, head) \x3d\x3e\n    put(arr, i, head)\n  }\n  return arr;\n}\n\nextern pure def emptyArray[T](initialSize: Int): Array[T] \x3d\n  "(new Array(${initialSize}))"\n\ndef get[T](arr: Array[T], index: Int): Option[T] \x3d\n  arr.unsafeGet(index).undefinedToOption\n\nextern pure def size[T](arr: Array[T]): Int \x3d\n  "${arr}.length"\n\nextern io def unsafeGet[T](arr: Array[T], index: Int): T \x3d\n  "${arr}[${index}]"\n\nextern !!!MULTILINEMARKER!!!\nfunction put(arr, index, value) {\n  arr[index] \x3d value;\n  return $effekt.unit\n}\n!!!MULTILINEMARKER!!!\n\nextern io def put[T](arr: Array[T], index: Int, value: T): Unit \x3d\n  "put(${arr}, ${index}, ${value})"\n\nextern pure def copy[T](arr: Array[T]): Array[T] \x3d\n  "[...${arr}]"\n\n// Utility functions:\n\ndef toList[T](arr: Array[T]): List[T] \x3d {\n  var i \x3d arr.size - 1;\n  var l \x3d Nil[T]()\n  while (i \x3e\x3d 0) {\n    l \x3d Cons(unsafeGet(arr, i), l)\n    i \x3d i - 1\n  }\n  l\n}\n\ndef foreach[T](arr: Array[T]){ action: T \x3d\x3e Unit / Control }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    val x: T \x3d arr.unsafeGet(i)\n    action(x)\n  }\n}\n\ndef foreachIndex[T](arr: Array[T]){ action: (Int, T) \x3d\x3e Unit / Control }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    val x: T \x3d arr.unsafeGet(i)\n    action(i, x)\n  }\n}\n\ndef sum(list: Array[Int]): Int \x3d {\n  var acc \x3d 0\n  list.foreach { x \x3d\x3e\n    acc \x3d acc + x\n  }\n  acc\n}\n');
